import React from 'react'
import './Flower.css'

export default function Flower() {
  return (
    <div>
      <div className='papaDiv'>
        <div className='bgDiv'>
          <img className='bgImg' src='./flower/background.png' alt='sky above a plot of earth' />
        </div>
      </div>

    </div>
  )
}
